package com.hcl.wm.order.util;

import com.hcl.wm.order.model.Customer;
import com.hcl.wm.order.model.Driver;
import com.hcl.wm.order.model.Item;
import com.hcl.wm.order.model.Order;
import org.springframework.stereotype.Component;

import java.util.ArrayList;
import java.util.List;

@Component
public class OrderUtil {
    public static String pdf = "";

    public static List<Order> createOrder() {
        List<Order> orders = new ArrayList<>();
        Order order = new Order();
        order.setId("1");
        Customer customer = new Customer();
        customer.setCust_Id("420");
        customer.setFirstName("Covid");
        customer.setLastName("19");
        order.setCustomer(customer);
        Driver driver = new Driver();
        driver.setDriver_id("123");
        driver.setPickedUpStatus("Y");
        driver.setDeliveredStatus("T");
        order.setDriver(driver);
        Item item = new Item();
        item.setItem_id("3");
        item.setItem_name("Maggie");
        item.setAvailable_qty("3");
        item.setRate("12");
        order.setItem(item);
        order.setQty(2);
        order.setInvoice("");
        orders.add(order);
        return orders;
    }
}
